import React, {useState} from 'react'
import { SideBar } from './siderbar'
import NavBar from './navbar'
import Footer from './footer'
import {routes} from './dashboardRoutes'
import { useRouter, } from 'next/router'

export const DashBoard = () => {
  const router = useRouter()

    return (
        <div  className="wrapper">
            <SideBar setHeading={(val)=>setHeading(val)}  />
            <div className="main-panel" style={{background:'#eee',}} >
                <NavBar heading={router?.query?.role?.replace(/_/," ")}/>
              <div style={{marginTop:"80px",minHeight:'85vh'}}> 
              {
                 routes.map((val,key)=>{
                     if(router?.query?.role === val.path){
                         activeRoute = val.name
                         return(
                             <div key={key}>
                         {val.component}
                         </div>
                     )
                    }
                 })
              }
              </div>
                <Footer/>
            </div>
        </div>
    )
}
